(function(){var n;n=angular.module("codefist");n.factory("gameService",["$http","urls",function(n,t){return{query:function(){return n.get(t.games)},gamesByUser:function(i){return n.get(t.gamesByUser(i))},create:function(i){return n.post(t.games,JSON.stringify(i))},get:function(i){return n.get(t.game(i))},"delete":function(i){return n["delete"](t.game(i))},update:function(i){return n.put(t.game(i.id),i)}}}])}).call(this)